import React from 'react'

const Persons = ({ persons }) => {
    return (
        <div>
            {
                persons.map(person =>
                    <>
                        <p key={person.id}>{person.name} {person.number}</p>
                        <button onClick={remove}>delete</button>
                    </>
                )
            }
        </div>
    )
}


export default Persons
